	private int db;
	private boolean is180;

	public Switch2x2NewHardCoded(@ParamName(name = "Switch ring driving power (mW)", default_ = DEFAULT_DRIVING_POWER_MW) double switchRingDrivingPower,
								 @ParamName(name="1 or 4 db ?", default_="1") int db,
								 @ParamName(name="180 or 90 ? (180 = true)") boolean is180) {
		super(switchRingDrivingPower);
		this.db = db;
		this.is180 = is180;
	}

	@Override
	public PowerPenalty getPowerPenalty(AbstractLinkFormat linkFormat, int numStages) {
		
		double[][] losses;
		
		if (db ==1) {
			if (is180) {
				losses = datadB1;
			} else {
				losses = datadB1_90;
			}
		} else {
			if (is180) {
				losses = datadB4;
			} else {
				losses = datadB4_90;
			}			
		}
		
		if (numStages >= losses.length)
			return new PowerPenalty(_2x2Switch, "switch",Double.MAX_VALUE);
		if (linkFormat.getNumberOfChannels() >= losses[0].length) {
			return new PowerPenalty(_2x2Switch, "switch",Double.MAX_VALUE);
		}
		return new PowerPenalty(_2x2Switch, "switch",losses[numStages][linkFormat.getNumberOfChannels()]);
	}

	@Override
	public Map<String, String> getAllParameters() {
		Map<String, String> map = new SimpleMap<>();
		map.put("db in ring", db+"");
		map.put("180degrees or not", is180 + "");
		return map;
	}

	@Override
	public double getSize() {
		return 0.000002;
	}

